import React from "react";
import styled from "styled-components";
import Ladyillus from "./Ladyillus";
import Parallex from "react-rellax";

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-image: linear-gradient(to bottom, #131424, #343b7c);
  display: flex;
`;
const Right = styled.div`
  flex: 1;
  background-color: red;
`;
const Left = styled.div`
  flex: 1;
`;
const Info = styled.div`
  background-color: yellow;
  margin-top: 30%;
`;
const Title = styled.h1`
  color: white;
  font-size: 76px;
  text-align: right;
  padding-right: 10% ;

`;
const Desc = styled.p`
  color: white;
  text-align: right;
  padding-right: 10% ;
`;
const OurMotive = () => {
  return (
    <>
      <Container>
        <Left>
          <Ladyillus />
        </Left>
        <Right>
          <Info>
              <Title>My Ambition</Title>
            <Desc>
              Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem quam
              earum eum beatae, officiis ad adipisci quos cumque quod quis
              numquam aliquid, optio odio saepe! Rerum, pariatur ab, recusandae
              molestiae dolorum laboriosam voluptate odio fugit reiciendis
              tempora at aliquam dolore?
            </Desc>
          </Info>
        </Right>
      </Container>
    </>
  );
};

export default OurMotive;
